import React, {Component} from 'react';

import './Footer.css';

class Footer extends Component {
  render() {
    return (
      <div className="footer" id="footer">
        <div className="medium-12 columns">
          <p style={{color:"white"}}>(C) TUATUA Production </p>
        </div>
      </div>
    );
  }
}

export default Footer;
